    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT - ( - + col0 ) BETWEEN + 91 AND - col1 * + col0 - - 8 + col2 + + + 88;
  - name: tab1

outputs:
  - name: q6061.out
    data: |
      51	14	96
      85	5	59
      91	47	68
